import React from "react";
import { useNavigate } from "react-router-dom";

function SignInSelector() {
  const navigate = useNavigate();

  const handleUserLogin = () => {
    navigate("/signin");  // Navigates to the existing SignIn.js for user login
  };

  const handleAdminLogin = () => {
    navigate("/admin-login"); // Navigates to AdminLogin component
  };

  return (
    <div>
      <h2>Select Login Type</h2>
      <button onClick={handleUserLogin}>User Login</button>
      <button onClick={handleAdminLogin}>Admin Login</button>
    </div>
  );
}

export default SignInSelector;
